type_list = ['LOCAL', 'CLOUD']

lat_pid_static = [186.67, 242.82]
lat_pid_dyn_low = [183.16, 238.17]
lat_pid_dyn_mod = [171.75, 221.38]
lat_pid_dyn_high = [170.76, 220.66]
lat_pid_asap = [121.36, 180.49]

lat_mpc_static = [88.82, 98.32]  #82.15
lat_mpc_dyn_low = [85.61, 97.61]  #80.42
lat_mpc_dyn_mod = [82.15, 93.88]
lat_mpc_dyn_high = [80.42, 92.64]
lat_mpc_asap = [77.24, 80.776]

barWidth = 0.1667
fig = plt.subplots(figsize =(12, 8))

br1 = np.arange(len(type_list))
br2 = [x + barWidth for x in br1]
br3 = [x + barWidth for x in br2]
br4 = [x + barWidth for x in br3]
br5 = [x + barWidth for x in br4]

plt.bar(br1, lat_pid_static, width = barWidth,
        edgecolor ='whitesmoke', label ='Static')
plt.bar(br2, lat_pid_dyn_low, color ='navajowhite', width = barWidth,
        edgecolor ='whitesmoke', label ='Dynamic (low)')
plt.bar(br3, lat_pid_dyn_mod, color ='lightcoral', width = barWidth,
        edgecolor ='whitesmoke', label ='Dynamic (moderate)')
plt.bar(br4, lat_pid_dyn_high, color ='mediumseagreen', width = barWidth,
        edgecolor ='whitesmoke', label ='Dynamic (high)')
plt.bar(br5, lat_pid_asap, color ='chocolate', width = barWidth,
        edgecolor ='whitesmoke', label ='ASAP')

plt.ylim(0, 250)
plt.xlabel('Controller Location', fontweight ='bold', fontsize = 15)
plt.ylabel('Time to Complete (s)', fontweight ='bold', fontsize = 15)
plt.xticks([r + barWidth for r in range(len(type_list))],
        type_list)
plt.title('PID Controller',fontweight = "bold")
 
plt.legend()
plt.show()

